import React from "react"
import style from "./Lists.module.css"
import List from "./List/List";

const Lists = (props) => {

    return (
        <div >
            <h2>Task Lists</h2>
            <List/>
            <span className={style.addButton} >+ New List</span>
        </div>
    )
}

export default Lists
